import React, { Component } from 'react'
import style from './Secondsection.module.css'

export default class Secondsection extends Component {

        constructor(props){
            super(props)
        }


    render() {
        // console.log(this.props.data)
        return (
            <div>
                <div className={style.main}>
                    <div className={style.arrenge}>
                        <div className={style.section_one}>
                            <h1 className={style.h1_text}>Build for Devlopers</h1>
                            <p>GitHub is a development platform inspired by the  way you work. From open source to business, you can host and review code, manage projects, and build software alongside 50 million developers.</p>
                        </div>
                        <div className={style.section_two}>
                            <div>
                                {this.props.data.map((a) =>{
                                    return(

                                        <p>{a.login}</p>
                                    )
                                    // <div className={style.search_output}>
                                    //     <img src={"/download.jpeg"} className={style.output_img}></img>
                                    //     <div>
                                    //         <h4>{a.login}</h4>
                                    //         <button>Get Details</button>
                                    //     </div>
                                    // </div>
                                    })
                                }
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
